#include <stdio.h>
#include <stdlib.h>
#include <string.h>

#include "geoip.h"

char *progname = "test_getcountrybyaddr6";

int test_getcountrybyaddr6( char *in, char *data_file, char *out )
{
    char *country;
    char *address;

    printf( "   getcountrybyaddr6( '%s', '%s', '%s' ) ", in, data_file, out );
    address = (char*)malloc(strlen(in)+1);
    memset(address, 0, strlen(in)+1);
    memcpy(address, in, strlen(in));

    country = getcountrybyaddr6( address, data_file );
    /*@-null@*/
    printf( " = '%s' ", country );
    /*@+null@*/
    free( address );

    if ( country == NULL && out == NULL ) {
        printf( "passed\n" );
        /*@-mustfreefresh@*/
        return( 0 );
        /*@+mustfreefresh@*/
    }
    if ( country != NULL && out == NULL ) {
        printf( "failed\n" );
        return( 1 );
    }
    if ( country == NULL && out != NULL ) {
        printf( "failed\n" );
        return( 1 );
    }
    if ( strlen( country ) == strlen( out ) ) {
        if ( strcmp( country,  out ) == 0 ) {
            printf( "passed\n" );
            /*@-mustfreefresh@*/
            return( 0 );
            /*@+mustfreefresh@*/
        }
    }

    printf( "failed\n" );
    /*@-mustfreefresh@*/
    return( 1 );
    /*@+mustfreefresh@*/
}

